import React from "react";
import Button from "react-bootstrap/Button";

export default function SingleUser(props) {
  return (
    <tr>
      <td>{props.user.id}</td>
      <td>{props.user.name}</td>
      <td>{props.user.username}</td>
      <td>{props.user.website}</td>
      <td>
        <div>
          <Button variant="info" onClick={props.handleDetails} className="mr-2">
            Details
          </Button>
          <Button
            variant="danger"
            onClick={() => props.handleDelete(props.user.id)}
          >
            {props.user.isLoadingDelete ? "Loading" : "Delete"}
          </Button>
        </div>
      </td>
    </tr>
  );
}
